import React from "react";
import "./Cart.css";

function Cart({ setopenCart }) {
  return (
    <>
      <div className="cart-body">
        <div className="header"></div>
        <div className="cart-body"></div>
        <div className="checkout"></div>
      </div>
      <button
        onClick={() => {
          setopenCart(false);
        }}
      >
        close
      </button>
    </>
  );
}

export default Cart;
